Panics if the pattern doesn't match an `Effect` from the specified `Update`

Like in a `match` expression, the pattern can be optionally followed by `if`
and a guard expression that has access to names bound by the pattern.

# Example

```
# use crux_core::testing::Update;
# enum Effect { Render(String) };
# enum Event { None };
# let effects = vec![Effect::Render("test".to_string())].into_iter().collect();
# let mut update = Update { effects, events: vec!(Event::None) };
use crux_core::assert_effect;
assert_effect!(update, Effect::Render(_));
```

727.docs:
Spawn a task which orchestrates across other capabilities.

The argument is a closure which receives a [`ComposeContext`] which can be used to send
events to the app.

For example:
```
# use crux_core::macros::Effect;
# use serde::Serialize;
# #[derive(Default, Clone)]
# pub struct App;
# #[derive(Debug, PartialEq)]
# pub enum Event {
#     Trigger,
#     Finished(usize, usize),
# }
# #[derive(Default, Serialize, Debug, PartialEq)]
# pub struct Model {
#     pub total: usize,
# }
# #[derive(Effect)]
# pub struct Capabilities {
#     one: doctest_support::compose::capabilities::capability_one::CapabilityOne<Event>,
#     two: doctest_support::compose::capabilities::capability_two::CapabilityTwo<Event>,
#     compose: crux_core::compose::Compose<Event>,
# }
# impl crux_core::App for App {
#    type Event = Event;
#    type Model = Model;
#    type ViewModel = Model;
#    type Capabilities = Capabilities;
#
    fn update(&self, event: Self::Event, model: &mut Self::Model, caps: &Self::Capabilities) {
        match event {
            Event::Trigger => caps.compose.spawn(|context| {
                let one = caps.one.clone();
                let two = caps.two.clone();

                async move {
                    let (result_one, result_two) =
                        futures::future::join(
                            one.one_async(10),
                            two.two_async(20)
                        ).await;

                    context.update_app(Event::Finished(result_one, result_two))
                }
            }),
            Event::Finished(one, two) => {
                model.total = one + two;
            }
        }
    }
#
#    fn view(&self, _model: &Self::Model) -> Self::ViewModel {
#        todo!()
#    }
# }
```

